;; @@
(defquery gaussian-mixture []
  (let [mode (sample (discrete [0.7 0.3]))
        theta (sample (normal 0 100))]
    (observe (case mode
               0 (normal 20 10)
               1 (normal -20 10))
             theta)
    theta))
    
;; @@
